import React from 'react';

function Button(props) {
  return (
    <div>
      <button onClick={props.onClick} Style ={{
        font: 'inherit',
        cursor: 'pointer',
        border: '1 px',
        color: 'white',
        padding: '1rem 2rem'
      }}>
        {props.children}
      </button>

      <Button onClick={() => setVisible(curVisible => !curVisible)}>
          {visible ? 'Hide' : 'Show'} Details
        </Button>
    </div>
  );
}

export default Button;
